var arrLeague = [31,'西班牙甲组联赛','西班牙甲組聯賽','Spanish Primera Division','2009-2010','#006633','league_match/images/20130218192828.jpg',38,38,'西甲','西甲','SPA D1','　　西班牙足球甲级联赛共由20支球队组成，采取双循环赛制（每支球队分别以主、客场身份和其他球队交锋两次）。单场比赛积分计算方法是胜者得3分、负者得0分、平局则双方各得1分，赛季末按累计积分高低排名。积分相同的2支球队以本赛季相互间的战绩决定；相互间的战绩仍不分上下，由得失球决定；如果出现3支或者3支以上球队同分，由球队间本赛季赛果形成的特别积分榜决定。<br/>&nbsp;　&nbsp;联赛前三名直接参加下赛季冠军联赛，第四名取得参加下赛季冠军联赛外围赛的资格，五、六名参加下赛季欧霸杯联赛（西班牙国王盃赛冠军也可获参加欧霸杯联赛，如果国王盃冠军已经取得欧战资格，则国王盃亚军将获得欧罗巴联赛参赛资格）。另外，本赛季西甲联赛规定升3降3，联赛排名榜尾的3支球队下赛季将降到乙级。'];
